import React from 'react';
import { Phone, User } from 'lucide-react';

function Header() {
  return (
    <div className="flex items-center justify-between p-4 bg-[#1f1b2e] text-white shadow-md">
      <h1 className="text-xl font-bold tracking-wide">Chat App</h1>
      <div className="flex items-center gap-4">
        <button className="hover:text-purple-400 transform hover:scale-105 transition">
          <Phone />
        </button>
        <button className="hover:text-pink-400 transform hover:scale-105 transition">
          <User />
        </button>
      </div>
    </div>
  );
}

export default Header;
